const Navbar = () => {
  return (
    // DaisyUI Navbar ðŸ”°ðŸ”°ðŸ”°
    <div className="navbar bg-base-100 shadow-md rounded-lg ">
      <div className="navbar-start">
        {/* <a className="btn btn-ghost normal-case text-3xl font-['Montserrat']">MateLy</a> */}
        
        <a
          href="/"
          aria-current="page"
          aria-label="Homepage"
          class="flex-0 btn btn-ghost px-2"
        >
          
          
          <div class="font-title text-primary inline-flex text-lg transition-all duration-200 md:text-3x1">
          
            <span class="lowercase">d</span>
            <span class="text-base-content uppercase">UI</span>
          </div>
        </a>
      </div>
      <div className="navbar-end">
        <a className="btn bg-primary shadow-md">Admin</a>
      </div>
    </div>
  );
};
export default Navbar;
